export default function Product({ product }) {
  return (
    <table
      style={{
        width: "25%",
        padding: "10px",
        boxSizing: "border-box",
      }}
    >
      <th>
      <strong>{product.name}</strong> ({product.description})</th>
      <th>
      <img
        src={product.imageUrl}
        alt={product.description}
        style={{
          display: "block",
          maxWidth: "100%",

        }}
      />
      </th>
    </table>
  );
}
